  `ingestion_datetime` datetime DEFAULT CURRENT_TIMESTAMP,
  `vendor_version` varchar(55) DEFAULT NULL,
  `vendor_name` varchar(100) DEFAULT NULL,
  `aco_id` varchar(10) DEFAULT NULL,
  `aco_name` varchar(200) DEFAULT NULL,
