  KEY `l2_table_id_idx` (`l2_table_id`),
  CONSTRAINT `l2_mandatory_columns_ibfk_1` FOREIGN KEY (`l2_table_id`) REFERENCES `buildsheet_master` (`id`)
) ENGINE=InnoDB;

